For simple courses that mostly have flashcards with a front and back, it's possible to declare the entire course in a single file with the help of the SimpleKnowledgeBaseCourse object. Simply write a JSON file that is the serialization of that type and call: trane-simple-build <PATH_TO_FILE> <OUTPUT_DIR> The trane-simple-build utility is found in the trane-cli repository. You can install it by cloning that repository and running the following command at the root of the repository: cargo install --path . Note that this assumes that you have installed the Rust toolchain. If you haven't, you can install it by following the instructions in the Rust website . Below is the specification of the SimpleKnowledgeBaseCourse type: /// Represents a simple knowledge base course which only specifies the course manifest and a list of
/// simple lessons. It is meant to help course authors write simple knowledge base courses by
/// writing a simple configuration to a single JSON file.
#[derive(Debug, Clone, PartialEq, Serialize, Deserialize)]
pub struct SimpleKnowledgeBaseCourse { /// The manifest for this course. pub manifest: CourseManifest, /// The simple lessons in this course. #[serde(default)] pub lessons: Vec<SimpleKnowledgeBaseLesson>,
} and the specification of the SimpleKnowledgeBaseLesson type referenced by the course type: /// Represents a simple knowledge base lesson which only specifies the short ID of the lesson, the
/// dependencies of the lesson, and a list of simple exercises. The instructions, material, and
/// metadata can be optionally specified as well. In a lot of cases, this is enough to deliver the
/// full functionality of Trane. It is meant to help course authors write simple knowledge base
/// courses by writing a simple configuration to a single JSON file.
#[derive(Debug, Clone, PartialEq, Serialize, Deserialize)]
pub struct SimpleKnowledgeBaseLesson { /// The short ID of the lesson. pub short_id: Ustr, /// The dependencies of the lesson. #[serde(default)] pub dependencies: Vec<Ustr>, /// The simple exercises in the lesson. #[serde(default)] pub exercises: Vec<SimpleKnowledgeBaseExercise>, /// The optional metadata for the lesson. #[serde(default)] pub metadata: Option<BTreeMap<String, Vec<String>>>, /// A list of additional files to write in the lesson directory. #[serde(default)] pub additional_files: Vec<AssetBuilder>,
}

