This shouldn't even have to be said, but comments should be written in clear language free of grammar and spelling mistakes. Comments explaining the why of a section of code are more important than comments answering what or how. However, there's still use for the latter. They allow a reader to quickly skim what a section of code does without having to read a line of code. Below is an example from Trane's scheduler module. /// Returns an initial stack with all the starting units in the graph that are used to search /// the entire graph. fn get_initial_stack(&self, metadata_filter: Option<&KeyValueFilter>) -> Vec<StackItem> { // First get all the starting units and then all of their starting lessons. let starting_units = self.get_all_starting_units(); let mut initial_stack: Vec<StackItem> = vec![]; for course_id in starting_units { // Set the depth to zero since all the starting units are at the same depth. let lesson_ids = self .get_course_valid_starting_lessons(&course_id, 0, metadata_filter) .unwrap_or_default(); if lesson_ids.is_empty() { // For units with no lessons, insert the unit itself as a starting unit so that its // dependents are traversed. initial_stack.push(StackItem { unit_id: course_id, depth: 0, }); } else { // Insert all the starting lessons in the stack. initial_stack.extend( lesson_ids .into_iter() .map(|unit_id| StackItem { unit_id, depth: 0 }), ); } } // Shuffle the lessons to follow a different ordering each time a new batch is requested. initial_stack.shuffle(&mut thread_rng()); initial_stack } Each file (or module, package, etc. depending on the language) should have a top-level comment that explains the purpose of the file and how it fits into the larger system. This comment should not explain the code in any or too much detail but present the reader with an account of the main design decisions that lead to structuring the code in this way. Below is an example from Trane's scheduler::cache module. //! Defines a cache that is used to retrieve unit scores and stores previously computed exercise and
