In this section, I will go over some of the steps I took to get to 100% code coverage. The first step was configuring grcov to exclude any arbitrary line or section from the coverage report. This is done in two steps. The first step was to modify the configuration file to exclude any line with the grcov-excl-line string from the final results. This allows me to exclude lines that are hard to test or not very relevant from the coverage report. For example: The modules that use SQLite call a method to prepare a statement. This is a fallible operation, but this particular line will never fail because the statement does not change. If a bad change to the statement were introduced, the tests would fail anyway. Here's an example from the practice_stats module, which stores the results of the user's practice sessions: // Retrieve the exercise trials from the database.
let connection = self.pool.get()?;
let mut stmt = connection .prepare_cached( "SELECT score, timestamp from practice_stats WHERE unit_uid = ( SELECT unit_uid FROM uids WHERE unit_id = ?1) ORDER BY timestamp DESC LIMIT ?2;", ) .with_context(|| "cannot prepare statement")?; //grcov-excl-line Adding an entry to the search index is also a fallible operation, but there are already tests that verify that search work, so there's little value in having a test that triggers this error. This is the code from the course_library module, which opens the courses stored in the file system for use with Trane: // Add the lesson manifest to the search index. Self::add_to_index_writer( index_writer, lesson_manifest.id, &lesson_manifest.name, &lesson_manifest.description, &lesson_manifest.metadata, )?; // grcov-excl-line The second step was to configure grcov to exclude entire sections of code from the report. For example, the Trane struct that is the main entry point for the library reimplements all the interfaces so that users do not have to access the fields of the struct to call those methods. Thus, those lines appeared as uncovered in the report but are actually covered by the all the other tests. I fixed this by configuring the excl-start and excl-stop options to exclude sections of the code from the final report. Here's an example of some of the code that was excluded: impl ReviewList for Trane { fn add_to_review_list(&mut self, unit_id: &Ustr) -> Result<()> { self.review_list.write().add_to_review_list(unit_id) } fn remove_from_review_list(&mut self, unit_id: &Ustr) -> Result<()> { self.review_list.write().remove_from_review_list(unit_id) } fn all_review_list_entries(&self) -> Result<Vec<Ustr>> { self.review_list.read().all_review_list_entries() }
} Once those two steps were configured, the coverage was around 90%. The remaining 10% consisted of edge cases that had not been tested yet. For example, there was no test to ensure that trying to open a Trane library with an invalid path would fail. Below is a list of example commits that introduce additional tests to cover those edge cases: Improve code coverage for scheduler module. Improve code coverage for graph module. Improve code coverage of course_builder module. There are about a dozen more commits that gradually took the coverage to 100%. Finally, the commit linked at the top of the post was the first one to reach 100% code coverage. This commit adds a test to verify that the score cache does not return a score for courses that have all of its lessons added to the blacklist.
